@arpit-agarwal, your change in https://github.com/apache/incubator-superset/pull/7907/ is not working for me. If I log the response received in `SupersetClient` I get:

```javascript
{json: {table_id: 23}, response: Response}
```

And because of this, `data` is undefined. I assume you just tested the raw HTTP response?

cc: @villebro

@jasnovak @mistercrunch Should this be in [PRs Status](https://github.com/apache/incubator-superset/projects/5) "Changes Requested"?

What needs to happen to get this merged? Can we just get it without the early `all_dashboard_access` check, and optimize later?

It's an important feature for extending superset in any not-purely-internal scenario

@villebro @mistercrunch @betodealmeida @john-bodley CI green! It is now or never! (Just kidding, take your time -- but if anyone feels like reviewing I'd appreciate feedback. Quoting Ville:
> The try/except additions in connectors/druid/models.py still feel slightly messy, but I feel they should be acceptable given the tradeoff of being able to drop problematic licenses. This is also something I feel we can get improve later if needed. Here I think @mistercrunch @john-bodley @betodealmeida could weigh in with comments on whether or not the current solution is appropriate.

)

_"FOSSA seems like the perfect tooling to do this, yet the ASF infra team won't let us install it."_;
 For the sake of the community can ASF not make an exception for FOSSA. We have been without an official release for way too long.

_"Unfortunately, this requires permissions we can't allow, namely repo:write and webhook/service:write"_; Is there a work around here to not break what I assume is some internal; guideline/process?
